export class RightToLeftView extends SampleBase<{}, {}> {
    private hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    public container: DocumentEditorContainerComponent;
    public titleBar: TitleBar;
        public toolbarOptions: any = [
        'New',
        'Open',
        'Separator',
        'Undo',
        'Redo',
        'Separator',
        'Image',
        'Table',
        'Hyperlink',
        'Bookmark',
        'TableOfContents',
        'Separator',
        'Header',
        'Footer',
        'PageSetup',
        'PageNumber',
        'Break',
        'Separator',
        'Find',
        'Separator',
        'Comments',
        'TrackChanges',
        'Separator',
        'LocalClipboard',
        'Separator',
        'FormFields',
        'UpdateFields',
    ];
    public rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        this.container.documentEditor.pageOutline = '#E0E0E0';
        this.container.documentEditor.acceptTab = true;
        this.container.documentEditor.resize();
        this.titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), this.container.documentEditor, true, true);
        this.onLoadDefault();
        this.titleBar.showButtons(false);
    }
    render() {
        return (<div className='control-pane'>
            <div className='control-section'>
                <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
                <div id="documenteditor_container_body">
                    <DocumentEditorContainerComponent id="container" ref={(scope) => { this.container = scope; }} style={{ 'display': 'block' }}
                       height={'590px'} toolbarMode={'Ribbon'} serviceUrl={this.hostUrl} toolbarItems={this.toolbarOptions} enableRtl={true} locale='ar-AE' enableToolbar={true} />
                </div>
            </div>
            <div id="action-description">
                <b>Right To left</b>
                <p>RTL provides an option to switch the text direction and layout of the editor component from right to left. It improves the user experiences and accessibility for users who use right-to-left languages (Arabic, Farsi, Urdu, etc.). To enable RTL document-editor, set the enableRtl to true.</p>
            </div>
            <div id="description">
                <p>In this example, you can see document-editor right-to-left and the locale set in arabic[locale value is ar-AE] </p>
                <p>By default, locale value is en-US. If you want to change the en-US culture to a different culture, you have to change the locale accordingly.</p>
                <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/right-to-left/">documentation section.</a>
                </p>
            </div>
        </div>);
    }
    onLoadDefault = (): void => {
        // tslint:disable
        let defaultDocument: object = {"sfdt":""};
        // tslint:enable       
        this.container.documentEditor.open(JSON.stringify(defaultDocument));
        this.container.documentEditor.documentName = 'الشروع';
        this.titleBar.updateDocumentTitle();
        this.container.documentEditor.documentEditorSettings.showRuler = true;
        this.container.documentChange = (): void => {
            this.titleBar.updateDocumentTitle();
            this.container.documentEditor.focusIn();
        };
    }

    change = (args):void=>{
        if (args.checked) {
            this.container.toolbarMode = 'Ribbon';
        }
        else {
            this.container.toolbarMode = 'Toolbar';
        }
        this.titleBar.showButtons(this.container.toolbarMode != 'Ribbon')
    }
}    
